import React, { useState } from 'react'
import Form from './Form'
import UploadImageZone from './UploadImageZone'

const FormHasImage = () => {
    const [formData, setFormData] = useState({
        image: ''
    })

    return (
        <Form title='Prompt Sketch to Image' onChange={(data) => setFormData({ ...formData, ...data })}>
            <UploadImageZone fileBase64={formData.image} onChange={(value) => { setFormData({ ...formData, image: value }) }} />
        </Form>
    )
}

export default FormHasImage
